import {BrowserRouter, Routes,Route} from 'react-router-dom'
import RouteOutlet from './RouterOutlet'
export default function RouteDefinitons(){

    return(
        <BrowserRouter>
            <Routes>
                <Route path='/' element={<RouteOutlet/>}>

                </Route>
            </Routes>
        </BrowserRouter>

    )
}
